import React from 'react';
import { useMsal } from '@azure/msal-react';
import { NavLink, Route, Switch, useHistory } from 'react-router-dom';
import PersonalPage from './PersonalPage';
import SharedPage from './SharedPage';

const HomePage = () => {
  const { accounts } = useMsal();
  const history = useHistory();

  const handleLogout = () => {
    accounts.forEach(account => {
      history.push(`/logout/${account.localAccountId}`);
    });
  };

  return (
    <div>
      <h1>Welcome to Home Page</h1>
      <button onClick={handleLogout}>Logout</button>
      <nav>
        <ul>
          <li><NavLink to="/home/personal">Personal</NavLink></li>
          <li><NavLink to="/home/shared">Shared</NavLink></li>
        </ul>
      </nav>
      <Switch>
        <Route path="/home/personal" component={PersonalPage} />
        <Route path="/home/shared" component={SharedPage} />
      </Switch>
    </div>
  );
};

export default HomePage;
